// Navbar.js
import React from 'react';
import { Navbar, Container, Nav, NavDropdown } from 'react-bootstrap';
import { Link } from 'react-router-dom';

function AppNavbar() {
  return (
    <Navbar expand="lg" style={{ backgroundColor: "gray" }}>
      <Container>
        <Navbar.Brand href="/" style={{ color: "white", fontSize: "150%", fontStyle: "italic" }}>
          ðŸŽ¬ MOVIES
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="navbarNavDropdown" />
        <Navbar.Collapse id="navbarNavDropdown">
          <Nav className="mr-auto">
            <Nav.Link as={Link} to="/home" style={{ color: "white" }}>
              Home
            </Nav.Link>
            <Nav.Link as={Link} to="/favorites" style={{ color: "white" }}>
              Favorites
            </Nav.Link>
            <NavDropdown title="Movies" id="movies-dropdown" style={{ color: "white" }}>
              <NavDropdown.Item as={Link} to="/popular">Popular</NavDropdown.Item>
              {/* Add more movie categories or links here */}
            </NavDropdown>
            <NavDropdown title="Account" id="account-dropdown" style={{ color: "white" }}>
              <NavDropdown.Item href="https://www.themoviedb.org/login">Login</NavDropdown.Item>
              <NavDropdown.Item href="#register">Register</NavDropdown.Item>
            </NavDropdown>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default AppNavbar;
